import dynamic from 'next/dynamic'
import React from 'react'

const NoSsr = props => (
  <React.Fragment>{props.children}</React.Fragment>
)

const oke = dynamic(
  () => import('./index/ListCategory'), 
  {
    ssr: false
  }
)

export default dynamic(() => Promise.resolve(NoSsr), {
  ssr: false
})
